(31, 6, 4, 'Dampak Kurang Tidur untuk Perkembangan Otak Anak', 'dampak-kurang-tidur-untuk-perkembangan-otak-anak', NULL, 'Dampak Kurang Tidur untuk AnakBeberapa orang mungkin menganggap bahwa cara tepat untuk mengatasi kurang tidur adalah mendapatkan waktu tidur lebih banyak di hari berikutnya. Kenyataannya, kurang tidur...', '<div><strong>Dampak Kurang Tidur untuk Anak</strong><br><br>Beberapa orang mungkin menganggap bahwa cara tepat untuk mengatasi kurang tidur adalah mendapatkan waktu tidur lebih banyak di hari berikutnya. Kenyataannya, kurang tidur tidak selalu dapat diatasi dengan tidur ekstra di malam berikutnya.<br><br>Seiring waktu, menurunnya kualitas setiap malam dapat memberikan dampak pada&nbsp; perilaku, kognitif (mental) dan emosional anak. Nah, berikut gejala yang bisa ditimbulkan dari kurang tidur.<br><br><br>1. Dampak kurang tidur untuk fisik anak:<br><br>Susah bangun pagi.<br>Tertidur setelah dibangunkan.<br>Sering menguap di siang hari.<br>Mengeluh merasa lelah atau ingin tidur siang.<br>Lebih suka berbaring di siang hari.<br>Tertidur atau tampak mengantuk di sekolah atau di rumah.<br>Ingin mengkonsumsi stimulan yang tidak sehat, seperti kafein atau gula, secara teratur.<br><br>2. Dampak kurang tidur untuk kognitif (mental) anak:<br><br>Kurang minat, motivasi dan perhatian untuk mengerjakan tugas sehari-hari.<br>Mudah lupa.<br>Penglihatan kabur.<br>Kesulitan mempelajari informasi baru.<br>Gejala emosional.<br>Peningkatan kemurungan dan lekas marah.<br>Peningkatan impulsif.<br>Mudah stres.<br>Utang tidur yang besar tidak akan cukup dibayar dengan tidur selama beberapa malam berturut-turut. Pada akhirnya, utang tidur ini dapat menyebabkan anak merasa lelah secara mental. Ini juga dapat memperburuk gejala gangguan perilaku, kecemasan, dan suasana hati seperti depresi atau gangguan bipolar.<br><br></div>', NULL, '2022-05-22 16:23:52', '2022-05-22 16:23:52'),
(32, 4, 4, 'Tampil Percaya Diri dengan Fashion Kasual', 'tampil-percaya-diri-dengan-fashion-kasual', NULL, 'Style Kekinian ?Mau tampil lebih colorful dari biasanya, coba pakai sweatpants yuk! Walaupun memiliki fungsi utama sebagai celana olahraga, sweatpants bisa kamu pakai sehari-hari untuk gaya outfit yan...', '<div><strong>Style Kekinian ?</strong><br><br>Mau tampil lebih colorful dari biasanya, coba pakai sweatpants yuk! Walaupun memiliki fungsi utama sebagai celana olahraga, sweatpants bisa kamu pakai sehari-hari untuk gaya outfit yang lebih keren lho. Nggak sulit untuk memadu-padankan sweatpants supaya terlihat kasual, cukup dengan gunakan fashion item yang tepat, kamu sudah berhasil tampil layaknya fashionista. Misalnya memasangkan sweatpants merah dengan hoodie dan coat, atau bergaya kekinian layaknya Billie Eilish dengan t-shirt dan beanie. Selengkapnya scrolling downs sekarang juga!<br><br><br>1. Sweatpants bisa berubah jadi semakin high fashion dengan mix &amp; match yang tepat lho. Mulai dengan memasangkan sweatpants dengan coat super tebal dan sneakers. Keren!</div>', NULL, '2022-05-22 16:24:38', '2022-05-22 16:24:38'),
(33, 5, 3, '5 Tips Untuk Membangun Personal Branding di Sosial Media', '5-tips-untuk-membangun-personal-branding-di-sosial-media', NULL, '5 Tips Untuk Membangun Personal Branding di Sosial Media Di era digital sekarang ini banyak sekali sosial media (sosmed) bermunculan. Sosial media, seperti Facebook, Instagram, Twtter, YouTube, sampai...', '<div><strong>5 Tips Untuk Membangun Personal Branding di Sosial Media </strong><br><br>Di era digital sekarang ini banyak sekali sosial media (sosmed) bermunculan. Sosial media, seperti Facebook, Instagram, Twtter, YouTube, sampai LinkedIn tentu punya peran positif kita, termasuk Anda. Salah satu dampak positif dari penggunaan sosial media adalah untuk membangun sebuah personal branding.&nbsp;<br><br><br>Sebelum membahas tips membangun personal branding, cari tahu dulu apa arti dari personal branding. Menurut Wikipedia, personal branding adalah proses di mana orang-orang dan karier mereka berlaku layaknya sebuah produk. Personal branding seringkali dikaitkan dengan suksesnya karier seseorang. \"Personal Branding adalah cara dan proses kita memasarkan diri kepada orang lain atau komunitas yang menjadi target kita.\"<br><br>Gelombang sosmed makin kuat. Setiap hari tidak lepas dari yang namanya sosmed. Update status, posting foto, video, atau konten menarik lain bukan hanya untuk eksistensi semata, tapi juga membangun personal branding. Kini penilaian orang lain terhadap pribadi seseorang juga didasarkan pada perilaku mereka di sosmed.<br>Tidak peduli apa jenis bidang karier yang Anda tekuni atau sedang dirintis, kehadiran Anda di berbagai sosmed amatlah penting untuk menyebarkan pesan pada orang lain tentang siapa dirimu. Kalau kamu merasa aktivitas berbagi, menyukai atau mengikuti sesuatu di sosmed tidak terlalu penting, maka siap-siap saja untuk duduk dan menikmati ribuan bahkan orang di luar sana yang berhasil mendapatkan perhatian dari orang lain di sekitarnya.</div>', NULL, '2022-05-22 16:26:04', '2022-05-22 16:26:04'),
(34, 1, 3, 'Pengertian dan Pengenalan Pemograman Web', 'pengertian-dan-pengenalan-pemograman-web', NULL, 'Pengertian Web ProgrammingPemrograman web diambil dari 2 suku kata yaitu pemrograman dan web. Pemrograman yang dalam bahasa English adalah programming dan diartikan proses, cara, perbuatan program.Def...', '<div><strong>Pengertian Web Programming</strong><br><br>Pemrograman web diambil dari 2 suku kata yaitu pemrograman dan web. Pemrograman yang dalam bahasa English adalah programming dan diartikan proses, cara, perbuatan program.<br><br>Definisi Web : jaringan komputer yang terdiri dari kumpulan situs internet yang menawarkan teks dan grafik dan suara dan sumber daya animasi melalui protokol transfer hypertext.<br><br>Orang banyak mengenal web dengan istilah WWW (world wide web), World Wide Web adalah layanan internet yang paling populer saat ini internet mulai dikenal dan digunakan secara luas setelah adanya layanan WWW . WWW adalah halaman-halaman website yang dapat saling terkoneksi satu dengan lainnya (hyperlink) yang membentuk samudra belantara informasi . WWW berjalan dengan protokol HyperText Transfer Protokol (HTTP). Halaman Web merupakan file teks murni (plain text) yang berisi sintaks-sintaks HTML yang dapat dibuka/ dilihat/ diterjemahkan dengan Internet Browser . Sintaks HTML mampu memuat konten text, gambar, audio, video dan animasi. Kini internet identik dengan web, karena kepopuleran web sebagai standar interface pada lanyanan-layanan yang ada di internet, dari awalnya sebagai penyedia informasi, ini digunakan juga untuk komunikasi dari email sampai dengan chatting, sampai dengan melakukan transaksi binsin (commerce) (Betha Sidik,Ir, Pemrograman web dengan HTML, Informatika Bandung, 2005) Banyak keuntungan yang diberikan oleh Aplikasi berbasis Web dari pada aplikasi berbasis destop, sehingga aplikasi berbasis web telah diadopsi oleh perusahaan sebagai bagian dari strategi teknologi informasinya, karena beberapa alasan :<br>Akses informasi mudah,<br>Setup server lebih mudah<br>Informasi mudah didistribusikan<br>Bebas platform, informasi dapat di sajikan oleh browser web pada sistem operasi mana saja karena adanya standar dokumen berbagai tipe data dapat disajikan</div>', NULL, '2022-05-22 16:27:16', '2022-05-22 16:27:16');
