(35, 3, 1, 'Mobile Programming untuk mahasiswa', 'mobile-programming-untuk-mahasiswa', NULL, 'Pengertian Pemrograman MobilePemrograman Mobile adalah pemrograman yang ditujukan untuk pembuatan aplikasi diperangkat mobile yang dapat kita buat dengan menggunakan Java. Keterbatasan yang sangat umu...', '<div><strong>Pengertian Pemrograman Mobile</strong><br><br>Pemrograman Mobile adalah pemrograman yang ditujukan untuk pembuatan aplikasi diperangkat mobile yang dapat kita buat dengan menggunakan Java. Keterbatasan yang sangat umum dalam bahasa pemrograman untuk peralatan mobile adalah kendala dalan segala dalam hal sumber daya, seperti ukuran layar, memori, CPU, penyimpanan dan cara menginput data. Perbedaan tampilan juga disebabkan adanya<br>perbedaan hardware dan API yang di gunakan. Berikut macam-macam Mobile Programming untuk ponsel :<br>J2ME<br>C++<br>Objective C<br>C#.<br>Javafx<br>PHP<br>Seperti namanya Mobile Programing adalah pemrogaman yang diterapkan di mobile/Handphone atau Laptop. Macam alat mobile yaitu antara lain :<br>Telepon Wireless<br>Tablet PC<br>Smartphone<br>Laptop<br>Handphone<br>dll<br>Pengembangan aplikasi mobile adalah proses dimana aplikasi perangkat lunak yang dikembangkan untuk daya rendah perangkat genggam , seperti asisten pribadi digital , perusahaan asisten digital atau ponsel . Aplikasi ini dapat diinstal pada ponsel selama manufaktur, didownload oleh pelanggan dari berbagai platform distribusi perangkat lunak ponsel , atau disampaikan sebagai aplikasi web menggunakan server-side atau sisi klien pengolahan (misalnya JavaScript) untuk memberikan pengalaman \"aplikasi-seperti\" dalam sebuah browser Web . Pengembang perangkat lunak aplikasi juga harus mempertimbangkan array panjang ukuran layar, spesifikasi hardware dan konfigurasi karena persaingan yang ketat dalam perangkat lunak mobile dan perubahan dalam setiap platform.<br><br>Sejarah &amp; Perkembangan<br>Perkembangan mobile computer hingga kini sangatlah luar biasa. Hal ini tidak lepas dari perkembangan-perkembangan mobile computer dari waktu ke waktu. Berikut dibahas sedikit mengenai sejarah perkembangan mobile computer, yakni :<br><br>Dynabook (1968)<br>Alan kay mengembangkan sebuah komputer portabel yang nantinya menawarkan sebuah media elektronik yang modern yang diperuntukan untuk anak anak. Graphical control interface dengan icon pada Komputer ini merupakan cikal bakal dari system operasi yang ada saat ini.<br><br><br></div>', NULL, '2022-05-22 16:28:11', '2022-05-22 16:28:11'),
(36, 2, 1, 'Kecerdasan Buatan/Artificial Intelligence', 'kecerdasan-buatan-artificial-intelligence', NULL, 'Sejarah Kecerdasan BuatanIstilah kecerdasan buatan diciptakan pada tahun 1956, tetapi AI telah menjadi kian populer saat ini berkat peningkatan volume data, algoritme canggih, dan peningkatan daya ser...', '<div><strong>Sejarah Kecerdasan Buatan</strong><br><br>Istilah kecerdasan buatan diciptakan pada tahun 1956, tetapi AI telah menjadi kian populer saat ini berkat peningkatan volume data, algoritme canggih, dan peningkatan daya serta penyimpanan komputasi.<br><br>Riset AI awal pada tahun 1950-an mengeksplorasi topik-topik seperti penyelesaian masalah dan metode simbolik. Pada tahun 1960-an, Departemen Pertahanan AS menaruh minat terhadap jenis pekerjaan ini dan mulai melatih komputer-komputer untuk menirukan penalaran manusia yang mendasar. Misalnya, Defense Advanced Research Projects Agency (DARPA) menyelesaikan proyek pemetaan jalan pada tahun 1970-an. Dan DARPA menghasilkan asisten pribadi cerdas pada tahun 2003, jauh sebelum Siri, Alexa atau Cortana diberi nama.<br><br>Pekerjaan awal ini membuka jalan bagi otomatisasi dan penalaran formal yang kita lihat di komputer saat ini, termasuk sistem pendukung keputusan dan sistem pencarian pintar yang dapat dirancang untuk melengkapi serta meningkatkan kemampuan manusia.<br><br>Sementara film-film Hollywood dan novel fiksi ilmiah menggambarkan AI sebagai robot mirip manusia yang mengambil alih dunia, evolusi teknologi AI saat ini tidak begitu menakutkan – atau cukup pintar. Sebaliknya, AI telah berevolusi untuk memberikan banyak manfaat spesifik di setiap industri. Teruslah membaca tentang contoh modern kecerdasan buatan dalam perawatan kesehatan, retail, dan lainnya.</div>', NULL, '2022-05-22 16:28:56', '2022-05-22 16:28:56'),
(37, 1, 2, 'Berkenalan Dengan Pemrograman Web', 'berkenalan-dengan-pemrograman-web', NULL, 'Apa Itu Pemrograman Web? Web Programming atau Pemrograman Web merupakan istilah yang erat kaitannya dengan internet dan website. Memang benar, karena pemrograman web merupakan suatu proses pembuatan w...', '<div><strong>Apa Itu Pemrograman Web? </strong><br><br>Web Programming atau Pemrograman Web merupakan istilah yang erat kaitannya dengan internet dan website. Memang benar, karena pemrograman web merupakan suatu proses pembuatan website untuk keperluan internet. Orang banyak mengenal web dengan istilah WWW atau World Wide Web.<br><br>Bahasa Pemrograman Web&nbsp;<br><br>Dalam semua ilmu tentang pemrograman baik itu desktop, mobile, game maupun software atau aplikasi lainnya pasti selalu ada bahasa-bahasa pemrograman yang digunakan untuk membuat aplikasi tersebut yang berisi statement-statement, perintah, atau pun fungsi agar aplikasi yang dibuat sesuai dengan apa yang telah didesain oleh si programmer. Oleh karena itu pemrograman web pun memiliki banyak bahasa yang digunakan, di antaranya:<br><br>HyperText Markup Language (HTML)<br>HTML sebenarnya bukan sebuah bahasa pemrograman, melainkan markup language atau bahasa penandaan yang terdiri dari kumpulan tag. Pada dasarnya HTML hanya mendeskripsikan bahwa bagian tertentu dalam sebuah halaman web adalah isi yang harus ditampilkan oleh browser dengan cara tertentu. HTML merupakan standar internet yang didefinisikan dan dikendalikan oleh World Wide Web Consortium (W3C).<br><br>Cascading Style Sheet (CSS)<br>CSS merupakan bahasa stylesheet yang digunakan untuk mengatur tampilan suatu dokumen yang ditulis dengan HTML. CSS juga memiliki css framework dan digunakan untuk menambah desain-desain tertentu pada halaman web agar desain halaman menarik untuk dilihat. Penggunaan CSS paling umum adalah untuk mengatur halaman web yang ditulis dengan HTML atau XHTML.<br><br>Hypertext Preprocessor (PHP)<br>Bahasa pemrograman PHP merupakan salah satu bahasa scripting yang wajib dikuasai oleh seorang web developer. Karena sifatnya yang server-side scripting, maka untuk menjalankan bahasa pemrograman PHP tidak bisa hanya memanggil file yang berekstensi PHP saja. Bahasa pemrograman PHP memerlukan sebuah web server untuk menjalankannya. PHP juga dapat diintegrasikan dengan HTML, JavaScript, jQuery, Ajax dan lain sebagainya. Akan tetapi pada umumnya bahasa pemrograman PHP digunakan bersamaan dengan file yang bertipe HTML agar file tersebut dapat menjalankan berbagai fungsi.</div>', NULL, '2022-05-22 16:29:44', '2022-05-23 07:35:44'),
